property.value:
actor Upsample (int factor) int I ==> int O :

  int state = 0;
  int mem;

  read: action I:[i] ==> O:[i]
  guard
   state = 0
  do
    mem := i;
   state := state +1;
  end

  copy: action ==> O:[mem]
  guard
    state > 0
  do
    state := state + 1;
    if state = factor then
      state := 0;
    end
  end

end

actor IDCTaddsub [ int ]
( int G,
  int OS,
  int ATTEN
) int I1, int I2 ==> int O1, int O2 :

  action I1:[i1], I2:[i2] ==> O1:[o1], O2:[o2]
  var
    int o1  = G * (i1 + i2) + OS,
    int o2  = G * (i1 - i2) + OS
  do
    // TODO replace div with >>
    if o1 < 0 then
      o1 := o1 - (ATTEN - 1);
    end
    o1 := o1 / ATTEN;
    // TODO replace div with >>
    if o2 < 0 then
      o2 := o2 - (ATTEN - 1);
    end
    o2 := o2 / ATTEN;
  end

end

