action I1:[i1], I2:[i2] ==> O1:[o1], O2:[o2] var int t = (W0 * ( i1 + i2 )) + OS, int o1 = t + (i1 * W1), int o2 = t + (i2 * W2) do // TODO replace with right shift if o1 < 0 then o1 := o1 - (ATTEN - 1); end o1 := o1 / ATTEN;
// TODO replace with right shift if o2 < 0 then o2 := o2 - (ATTEN - 1); end o2 := o2 / ATTEN; end
end

